  return (
    <tr>
      <td className="td-name">Sukienkaminimaxitopokraglyknited</td>
      <td>Zara</td>
      <td>120PLN</td>
      <td>100PLN</td>
      <td>
        <input type="checkbox" className="tracked-checkbox" />
      </td>
    </tr>
  );
};

